import "./ExpensesList.css"

export default ExpensesList=(props)=>{
    let expensesContent = <p>No expenses found.</p>

    if(props.items.length > 0){
        expensesContent = props.items.map((expenses) => (<ExpenseItems key={expenses.id} title={expenses.title} amount={expenses.amount} date={expenses.date} />))
    }
}
